function formatNumber(n){
  if(!n) return '0';
  if(n>=1e8) return (n/1e8).toFixed(1)+'äº¿';
  if(n>=1e4) return (n/1e4).toFixed(1)+'ä¸‡';
  return n.toString();
}

function getLevelClass(l){
  if(l>=20) return 'level-20';
  if(l>=16) return 'level-16';
  if(l>=12) return 'level-12';
  return 'level-below';
}
